 link or copying and pasting it into your browser:\n\n[user:cancel-url]\n\nNOTE: The cancellation of your account is not reversible.\n\nThis link expires in one day and nothing will happen if it is not used.\n\n--  [site:name] team','','8.3.0'),(4806,'Account cancellation request for [user:display-name] at [site:name]','','8.3.0'),(4807,'[user:display-name],\n\nA request to reset the password for your account has been made at [site:name].\n\nYou may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password. It expires after one day and nothing will happen if it\'s not used.\n\n--  [site:name] team','','8.3.0'),(4808,'Replacement login information for [user:display-name] at [site:name]','','8.3.0'),(4809,'[user:display-name],\n\nA site administrator at [site:name] has created an account for you. You may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password.\n\nAfter setting your password, you will be able to log in at [site:login-url] in the future using:\n\nusername: [user:name]\npassword: Your password\n\n--  [site:name] team','','8.3.0'),(4810,'[user:display-name],\n\nThank you for registering at [site:name]. You may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password.\n\nAfter setting your password, you will be able to log in at [site:login-url] in the future using:\n\nusername: [user:name]\npassword: Your password\n\n--  [site:name] team','','8.3.0'),(4811,'Account details for [user:display-name] at [site:name]','','8.3.0'),(4812,'[user:display-name],\n\nThank you for registering at [site:name]. Your application for an account is currently pending approval. Once it has been approved, you will receive another email containing information about how to log in, set your password, and other details.\n\n\n--  [site:name] team','','8.3.0'),(4813,'Account details for [user:display-name] at [site:name] (pending admin approval)','','8.3.0'),(4814,'[user:display-name] has applied for an account.\n\n[user:edit-url]','','8.3.0'),(4815,'[user:display-name],\n\nYour account at [site:name] has been activated.\n\nYou may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password.\n\nAfter setting your password, you will be able to log in at [site:login-url] in the future using:\n\nusername: [user:account-name]\npassword: Your password\n\n--  [site:name] team','','8.3.0'),(4816,'Account details for [user:display-name] at [site:name] (approved)','','8.3.0'),(4817,'[user:display-name],\n\nYour account on [site:name] has been canceled.\n\n--  [site:name] team','','8.3.0'),(4818,'Account details for [user:display-name] at [site:name] (canceled)','','8.3.0'),(4819,'Authenticated user','','8.3.0'),(4820,'Custom block library','','8.3.0'),(4821,'‹ Previous','','8.3.0'),(4822,'Next ›','','8.3.0'),(4823,'Recent comments.','','8.3.0'),(4824,'Lists (Views)','','8.3.0'),(4825,'Find and manage files.','','8.3.0'),(4826,'Fid','','8.3.0'),(4827,'1 place@count places','','8.3.0'),(4828,'No files available.','','8.3.0'),(4829,'Files overview','','8.3.0'),(4830,'Registering module','','8.3.0'),(4831,'1@count','','8.3.0'),(4832,'File usage information for {{ arguments.fid }}','','8.3.0'),(4833,'Adding languages','','8.3.0'),(4834,'<p>This page provides the ability to add common languages to your site.</p><p>If the desired language is not available, you can add a custom language.</p>','','8.3.0'),(4835,'<p>Choose a language from the list, or choose \"Custom language...\" at the end of the list.</p><p>Click the \"Add language\" button when you are done choosing your language.</p><p>When adding a custom language, you will get an additional form where you can provide the name, code, and direction of the language.</p>','','8.3.0'),(4836,'Continuing on','','8.3.0'),(4837,'<p>Now that you have an overview of the \"Add languages\" feature, you can continue by:<ul><li>Adding a language</li><li>Adding a custom language</li><li><a href=\"[site:url]admin/config/regional/language\">Viewing configured languages</a></li></ul></p>','','8.3.0'),(4838,'Editing languages','','8.3.0'),(4839,'<p>This page provides the ability to edit a language on your site, including custom languages.</p>','','8.3.0'),(4840,'<p>You cannot change the code of a language on the site, since it is used by the system to keep track of the language.</p>','','8.3.0'),(4841,'<p>The language name is used throughout the site for all users and is written in English. Names of built-in languages can be translated using the Interface Translation module, and names of both built-in and custom languages can be translated using the Configuration Translation module.</p>','','8.3.0'),(4842,'Language direction','','8.3.0'),(4843,'<p>Choose if the language is a \"Left to right\" or \"Right to left\" language.</p><p>Note that not all themes support \"Right to left\" layouts, so test your theme if you are using \"Right to left\".</p>','','8.3.0'),(4844,'<p>Now that you have an overview of the \"Edit language\" feature, you can continue by:<ul><li>Editing a language</li><li><a href=\"[site:url]admin/config/regional/language\">Viewing configured languages</a></li></ul></p>','','8.3.0'),(4845,'<p>The \"Languages\" page allows you to add, edit, delete, and reorder languages for the site.</p>','','8.3.0'),(4846,'<p>To add more languages to your site, click the \"Add language\" button.</p><p>Added languages will be displayed in the language list and can then be edited or deleted.</p>','','8.3.0'),(4847,'Reordering languages','','8.3.0'),(4848,'<p>To reorder the languages on your site, use the drag icons next to each language.</p><p>The order shown here is the display order for language lists on the site such as in the language switcher blocks provided by the Interface Translation and Content Translation modules.</p><p>When you are done with reordering the languages, click the \"Save configuration\" button for the changes to take effect.</p>','','8.3.0'),(4849,'Set a language as default','','8.3.0'),(4850,'<p>You can change the default language of the site by choosing one of your configured languages as default. The site will use the default language in situations where no choice is made but a language should be set, for example as the language of the displayed interface.</p>','','8.3.0'),(4851,'Modifying languages','','8.3.0'),(4852,'<p>Operations are provided for editing and deleting your languages.</p><p>You can edit the name and the direction of the language.</p><p>Deleted languages can be added back at a later time. Deleting a language will remove all interface translations associated with it, and content in this language will be set to be language neutral. Note that you cannot delete the default language of the site.</p>','','8.3.0'),(4853,'<p>Now that you have an overview of the \"Languages\" page, you can continue by:<ul><li><a href=\"[site:url]admin/config/regional/language/add\">Adding a language</a></li><li>Reordering languages</li><li>Editing a language</li><li>Deleting a language</li></ul></p>','','8.3.0'),(4854,'User interface translation','','8.3.0'),(4855,'This page allows you to translate the user interface or modify existing translations. If you have installed your site initially in English, you must first add another language on the <a href=\"[site:url]admin/config/regional/language\">Languages page</a>, in order to use this page.','','8.3.0'),(4856,'Translation language','','8.3.0'),(4857,'Choose the language you want to translate.','','8.3.0'),(4858,'Enter the specific word or sentence you want to translate, you can also write just a part of a word.','','8.3.0'),(4859,'Filter the search','','8.3.0'),(4860,'You can search for untranslated strings if you want to translate something that isn\'t translated yet. If you want to modify an existing translation, you might want to search only for translated strings.','','8.3.0'),(4861,'Apply your search criteria','','8.3.0'),(4862,'To apply your search criteria, click on the <em>Filter</em> button.','','8.3.0'),(4863,'You can write your own translation in the text fields of the right column. Try to figure out in which context the text will be used in order to translate it in the appropriate way.','','8.3.0'),(4864,'Validate the translation','','8.3.0'),(4865,'When you have finished your translations, click on the <em>Save translations</em> button. You must save your translations, each time before changing the page or making a new search.','','8.3.0'),(4866,'The translations you have made here will be used on your site\'s user interface. If you want to use them on another site or modify them on an external translation editor, you can <a href=\"[site:url]admin/config/regional/translate/export\">export them</a> to a .po file and <a href=\"[site:url]admin/config/regional/translate/import\">import them</a> later.','','8.3.0'),(4867,'All content, by month.','','8.3.0'),(4868,'{{ arguments.created_year_month }}','','8.3.0'),(4869,'« First','','8.3.0'),(4870,'Last »','','8.3.0'),(4871,'Published status','','8.3.0'),(4872,'Find and manage content','','8.3.0'),(4873,'Recent content.','','8.3.0'),(4874,'All content promoted to the front page.','','8.3.0'),(4875,'Welcome to [site:name]','','8.3.0'),(4876,'All content, by letter.','','8.3.0'),(4877,'Content belonging to a certain taxonomy term.','','8.3.0'),(4878,'{{ arguments.tid }}','','8.3.0'),(4879,'Name or email contains','','8.3.0'),(4880,'Shows a list of the newest user accounts on the site